// SPDX-License-Identifier: GPL-3.0


pragma solidity >=0.5.0 <0.9.0;
contract Lottery {
    address payable[] public players;
    address public  manager;
    address payable public winner;

    constructor(){
        manager = msg.sender;

    }
    receive() external payable { 
        require(msg.value==0.1 ether,"Please pay 1 ether only!!");
        players.push(payable(msg.sender));
    }
    function getBalance() public view returns(uint){
        // require(manager==msg.sender, "You are not the manager");
         require(msg.sender == manager, "You are not the manager");
        return address(this).balance;
    }
    // function random() internal  view returns(uint){
    //     return uint(keccak256(abi.encodePacked(block.difficulty,block.timestamp,players.length)));
    // }
    
    function Getrandom() internal view returns (uint) {
        return uint(
            keccak256(
                abi.encodePacked(
                    block.timestamp,
                    players.length
                )
            )
        );
    }
    
    // function pickWinner() public {
    //     require(msg.sender == manager, "you are not the manager");
    //     require(players.length >= 3, "Players are less than 3");

    //     uint r = Getrandom();
    //     uint index= r%players.length;
    //     winner = players[index];
    //     winner.transfer(getBalance());
    //     players = new address payable[](0);
    // }
 function pickWinner() public {
    require(msg.sender == manager, "You are not the manager");
    require(players.length >= 3, "Players are less than 3");

    uint r = Getrandom();
    uint index = r % players.length;

    address payable selectedWinner = players[index];
    winner = selectedWinner;

    // EFFECT FIRST (reset state)
    delete players;


    // INTERACTION
    (bool success, ) = selectedWinner.call{value: address(this).balance}("");
    require(success, "Ether transfer failed");
}





    function allPlayers() public view returns (address payable[] memory){
        return players;
    }

}
